const data = [
  {
    name: "Pizza Express",
    description: "Somewhere over the pizza",
    reviews: [],
    cuisines: ["Pizza"],
  },
  {
    name: "Franco Manca",
    description: "Somewhere over the rainbox",
    reviews: [],
    cuisines: ["Pizza"],
  },
];

const RestaurantList = () => {
  return (
    <section>
      <ul>
        {data.map((restaurant) => (
          <li>{restaurant.name}</li>
        ))}
      </ul>
    </section>
  );
};

export default RestaurantList;
